# -*- coding: utf-8 -*-def password_level(p):    de = (p.isalnum() and (p.isupper() or p.islower()))    if len(p) < 6:        return 'Недопустимый пароль'    elif p.isdigit() or (p.islower() and p.isalpha()) or (p.isupper() and p.isalpha()):        return 'Ненадежный пароль'    elif (p.isalpha() and not p.islower() and not p.isupper()) or de:        return 'Слабый пароль'    else:        return 'Надежный пароль'